  false,\n\t\"url\": null,\n\t\"notes\": \"These data are a set of ARC/INFO coverages
  composed of polygonal and linear features. Coverages are based on official New York
  State Freshwater Wetlands Maps as described in Article 24-0301 of the Environmental
  Conservation Law. Coverages are not, however, a legal substitute for the official
  maps. Coverages are available on a county basis for all areas of New York State
  outside the Adirondack Park.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
